
Alter table WinConfirmations add addressVerify varchar(2000) after payPalTransactionId;

Create table HasSigned (
playerId int unsigned primary key,
audit_user_id int unsigned not null,
created timestamp default current_timestamp on update current_timestamp);

Create table PaypalAudits (
id int unsigned primary key auto_increment,
info text,
