updated timestamp default current_timestamp on update current_timestamp);

Alter table PaypalAudits add win_confirmation_id int unsigned NOT NULL after id;
Alter table PaypalAudits add status varchar(20) NOT NULL after win_confirmation_id;
Alter table PaypalAudits add amount decimal(10,2) NOT NULL after status;
Alter table PaypalAudits add xaction_id varchar(50) NOT NULL after amount;

